<div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>基本执行流程：</p>
<ul>
<li><code>make</code>会在当前目录下找到一个名字叫<code>Makefile</code>或<code>makefile</code>的脚本文件</li>
<li>如果找到，他会找脚本文件中第一个目标（target），把目标实现，即生成目标文件
<ul>
<li>如果目标文件不存在，或者目标文件依赖的.o文件（prerequities）更新（即依赖文件修改时间比目标文件修改时间更新），则会执行目标（target）后面所定义的命令（command）来生成目标文件</li>
<li>如果目标文件依赖的.o文件（prerequities）不存在，则make会找到目标为该.o文件的规则，生成该.o文件，然后重新生成目标文件</li>
</ul>
</li>
</ul>

